const Navbar = () => {
  return (
    <nav
      id="navbar"
      className="min-w-full bg-gray-900 text-orange-50 min-h-[6rem] content-center items-center"
    >
      <ul className="flex flex-row gap-[3rem] justify-end ">
        <li>Leaderboard</li>
        <li>IDK THA</li>
        <li>WHATEVER</li>
      </ul>
    </nav>
  );
};

export default Navbar;
